        getStatusDate: function() {
            var ganttConfigStore = Ext.getStore('GanttConfigStoreXml'),
                date = ganttConfigStore.getAt(ganttConfigStore.findExact('name','statusDate')).get('value');
            date = String(date).split(",");
            var myYr = date[0];
            var myMth = date[1];
            var myDay = date[2];
            date = myMth+ "/"+myDay+"/"+myYr;
            return date;
        },

